  true,\n\t\"url\": null,\n\t\"notes\": \"***As of July 19, 2015, the PD District
  boundaries have been updated through a redistricting process. These new boundaries
  are not reflected in the dataset yet so you cannot compare data from July 19, 2015
  onward to official reports from PD with the Police District column. We are working
  on an update to the dataset to reflect the updated boundaries starting with data
  entered July 19 onward.***rnrnIncidents derived from SFPD Crime Incident Reporting
  system  Updated daily, showing data from 1/1/2003 up until two weeks ago from current
  date. Please note: San Francisco police have implemented a new system for tracking
  crime. The dataset included here is still coming from the old system, which is in
  the process of being retired (a multi-year process).  Data included here is no longer
  the official SFPD data. We will migrate to the new system for DataSF in the upcoming
  months.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
